	int64 usedBytes = 5;
	int64 nodeRegionId = 6;
	int64 trafficPackagePeriodId = 7;
	int32 trafficPackagePeriodCount = 8;
	string trafficPackagePeriodUnit = 9;
	string dayFrom = 10;
	string dayTo = 11;
	int64 createdAt = 12;

	TrafficPackage trafficPackage = 30;
	NodeRegion nodeRegion = 31;
	User user = 32;
	bool canDelete = 33;
}

message ValidateHTTPCacheTaskKeysResponse {
	repeated FailKey failKeys = 1;


	message FailKey {
		string key = 1;
		string reasonCode = 2;
	}
}

message ValidateUserVerifyCodeRequest {
	string type = 1; // 类型：重置密码（resetPassword）
	string email = 2; // 已验证邮箱地址
	string mobile = 3; // 已验证手机号
	string code = 4; // 验证码

	// 找回密码
	string newPassword = 10; // 新密码
}

message ValidateUserVerifyCodeResponse {
	bool isOk = 1; // 是否成功
	string errorCode = 2; // 错误代号
	string errorMessage = 3; // 错误消息
}

message VerifyUserEmailRequest {
	string code = 1; // 激活码
}

message VerifyUserEmailResponse {
	int64 userId = 1; // 邮箱对应的用户ID
	string email = 2; // 邮箱地址
	string errorCode = 3; // 错误代号，如果为空，说明没有错误
	string errorMessage = 4; // 错误信息
}

message VerifyUserRequest {
	int64 userId = 1;
	bool isRejected = 2;
	string rejectReason = 3;
}

message WriteHTTPAccessLogPolicyRequest {
	int64 httpAccessLogPolicyId = 1;
	HTTPAccessLog httpAccessLog = 2;
}

message WriteLoginSessionValueRequest {
	string sid = 1;
	string key = 2;
	string value = 3;
}

