# HTTP协议配置

## 定义
~~~json
{
	"isOn": "是否启用",
  	"listen": [
      {
		"protocol": "协议",
		"host": "主机地址，通常为空",
		"portRange": "端口或者端口范围"
	  },
	  ...
	]
}
~~~

## 示例

### 监听80端口
~~~json
{
  "isOn": true,
  "listen": [
    {
      "protocol": "http",
      "host": "",
      "portRange": "80"
	}
  ]
}
~~~

### 监听80和8080端口
~~~json
{
  "isOn": true,
  "listen": [
    {
      "protocol": "http",
      "portRange": "80"
	},
    {
      "protocol": "http",
      "portRange": "8080"
	}
  ]
}
~~~

# HTTPS协议配置

## 定义
~~~json
{
	"isOn": "是否启用",
  	"listen": [
      {
		"protocol": "协议",
		"host": "主机地址，通常为空",
		"portRange": "端口或者端口范围"
	  },
	  ...
	],
  	"sslPolicyRef": {
	  "isOn": "启用SSL策略",
	  "sslPolicyId": "SSL策略ID"
	}
}
~~~

其中 `SSL策略ID` 通过 `/SSLPolicyService/createSSLPolicy` 接口创建。

## 示例

### 监听443端口
~~~json
{
  "isOn": true,
  "listen": [
    {
      "protocol": "https",
      "host": "",
      "portRange": "443"
	}
  ],
  "sslPolicyRef": {
    "isOn": true,
    "sslPolicyId": 123
  }
}
~~~

其中SSL策略ID `123` 通过 `/SSLPolicyService/createSSLPolicy` 接口创建。

### 监听443和8443端口
~~~json
{
  "isOn": true,
  "listen": [
    {
      "protocol": "https",
      "portRange": "443"
	},
    {
      "protocol": "https",
      "portRange": "8443"
	}
  ],
  "sslPolicyRef": {
    "isOn": true,
    "sslPolicyId": 123
  }
}
~~~

其中SSL策略ID `123` 通过 `/SSLPolicyService/createSSLPolicy` 接口创建。

# 源站引用列表

## 定义
~~~json
[
  {
	"isOn": "是否启用",
	"originId": "源站ID 1"
  },
  {
    "isOn": "是否启用",
    "originId": "源站ID 2"
  },
  ...
]
~~~

其中：
* `originId` - 源站ID，可以通过 `/OriginService/createOrigin` 接口创建源站后获得

## 示例
~~~json
[
  {
	"isOn": true,
	"originId": 1
  },
  {
    "isOn": true,
    "originId": 2,
  }
]
~~~

# 域名信息列表

## 定义
~~~
[ 域名信息1, 域名信息2, ... ]
~~~
其中 `域名信息N` 等是单个域名信息定义，具体请参考 {json:server_name}

## 示例
### 示例1：单个域名
~~~json
[
	{
		"name": "example.com",
		"type": "full"
	}
]
~~~

### 示例2：多个域名
~~~json
[
	{
		"name": "example.com",
		"type": "full"
	},
	{
      	"name": "google.com",
      	"type": "full"
  	},
  	{
		"name": "facebook.com",
	  	"type": "full"
  	}
]
~~~

### 示例3：域名合集
域名合集效果跟多个域名是一样的，只不过在界面上以一个目录的形式呈现。
~~~json
[
  	{
		"name": "",
	  	"type": "full",
	  	"subNames": ["example.com", "google.com", "facebook.com"]
  	}
]
~~~

# SSL证书引用

可以用来引用一组证书。

## 定义
~~~json
[
  {
	"isOn": "是否启用",
	"certId": "证书ID 1"
  },
  {
    "isOn": "是否启用",
    "certId": "证书ID 2"
  },
  ...
]
~~~

## 示例
~~~json
[
  {
    "isOn": true,
    "certId": 12345
  },
  {
    "isOn": true,
    "certId": 12346
  }
]
~~~

其中：
* `certId` - 证书的ID

